import '../CSS/Menu.css';

function Menu(props) {
     const database = props.database;
     console.log(database);

     function displayMenu() {
          database.map((item, i) => {
               console.log(i);
               return <div key={i + 1}>{item.food}</div>;
          });
     }

     return (
          <div className='menu_list'>
               <div>{displayMenu()}</div>
          </div>
     );
}

export default Menu;
